import React, { Component } from 'react'
import '../style.css';
Lin
function List(props) {
    return (
        <div>
            <img alt="example" src={props.link} style={{ width: "20px", height: "20px" }} />
            <Link href={props.link1}>Home</Link>
        </div>
    )
}

export default class Instagram extends Component {
    render() {
        const background = {
            backgroundColor: this.props.bgcolor,
        };
        return (
            <div className="wrapper">
                <Space>
                    <div className="Item-info" style={background}>
                        <List link="https://imgur.com/crJ7aOU.png" link1="https://www.instagram.com/shafasphere/" nama="shafasphere" />
                        <List link="https://imgur.com/crJ7aOU.png" link1="https://www.instagram.com/fadhli_fadra/" nama="fadhli_fadra" />
                    </div>
                </Space>
            </div>
        );
    }
}
